import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { useOrder } from '../context/OrderContext';
import BackButton from '../components/BackButton';

const Profile = () => {
  const { user, logout } = useAuth();
  const { orderHistory } = useOrder();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  const recentOrders = orderHistory.slice(0, 3);
  const totalOrders = orderHistory.length;
  const totalSpent = orderHistory.reduce(
    (sum, order) => sum + (order.total || 0),
    0
  );

  return (
    <div className="profile-page">
      <BackButton />
      <div className="container">
        <div className="page-header-section">
          <h1>My Profile</h1>
          <p>View your account details and order activity</p>
        </div>

        <div className="profile-layout">
          <div className="profile-card">
            <h2>Account Info</h2>
            <p>
              <strong>Name:</strong> {user?.name || 'New user'}
            </p>
            <p>
              <strong>Email:</strong> {user?.email}
            </p>
            <p>
              <strong>Phone:</strong> {user?.phone || 'Not set'}
            </p>
            <button className="btn btn-secondary" onClick={handleLogout}>
              Logout
            </button>
          </div>

          <div className="profile-stats">
            <div className="profile-stat-card">
              <p>Total Orders</p>
              <h3>{totalOrders}</h3>
            </div>
            <div className="profile-stat-card">
              <p>Total Spent</p>
              <h3>৳{totalSpent.toFixed(2)}</h3>
            </div>
          </div>
        </div>

        <div className="profile-orders-section">
          <h2>Recent Orders</h2>
          {totalOrders === 0 ? (
            <p>No orders yet. Start ordering now!</p>
          ) : (
            recentOrders.map((order) => {
              const orderId = order.orderId || order.id || order._id;
              const orderDate = order.date || order.orderDate;
              return (
                <div key={orderId} className="profile-order-card">
                  <div>
                    <h3>Order #{orderId}</h3>
                    <p>
                      {orderDate
                        ? new Date(orderDate).toLocaleDateString('en-US', {
                            year: 'numeric',
                            month: 'short',
                            day: 'numeric',
                          })
                        : 'Date not available'}
                    </p>
                  </div>
                  <div>
                    <p>Items: {order.items?.length || 0}</p>
                    <p>Total: ৳{order.total?.toFixed(2) || 0}</p>
                  </div>
                </div>
              );
            })
          )}
        </div>
      </div>
    </div>
  );
};

export default Profile;
